            salad: 1,
            bacoon: 1,
            cheese: 2,
            meat: 2
        }
    }
    render () {
        return (
            <Aux>
                <Burger />
                <div>Burger Controls</div>
            </Aux>
        );
    }
}

export default BurgerBuilder;
